import './App.css';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Main from './components/Main/main.jsx';
import ShowAll from './components/ShowAll/showAll.jsx';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route exact path='/' element={<Main />}></Route>
      </Routes>
    </div>
  );
}

export default App;
